import './App.css';
import Signup from './Components/Signup';
import Login from './Components/Login';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' component={<Signup/>} />
        <Route path='/login' component={<Login/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
